import {
  FaFacebookF,
  FaTwitter,
  FaLinkedinIn,
  FaBasketballBall,
} from "react-icons/fa";
import classes from "./Footer.module.css";

const Footer = () => {
  return (
    <>
      <div className={classes.footerContainer}>
        <div>
          <h1>LOCATION</h1>
          <p>2215 John Daniel Drive</p>
          <p>Clark, MO 65243</p>
        </div>
        <div>
          <h1>AROUND THE WEB</h1>
          <FaFacebookF size={30} className={classes.webIconsContainer} />
          <FaTwitter size={30} className={classes.webIconsContainer} />
          <FaLinkedinIn size={30} className={classes.webIconsContainer} />
          <FaBasketballBall size={30} className={classes.webIconsContainer} />
        </div>
        <div>
          <h1>ABOUT FREELANCER</h1>
          <p>
            Freelance is a free to use, MIT licensed Bootstrap theme created by
            Start Bootstrap.
          </p>
        </div>
      </div>
    </>
  );
};

export default Footer;
